             x="890.5332"

             id="tspan25576">WHAT  S UNDER THE HOOD?
    </tspan><tspan
             x="890.5332"
             y="866.06018"
             id="tspan25578">    </tspan></text>
        <text
           xml:space="preserve"
           transform="matrix(0.09563294,0,0,0.10893814,24.216853,68.87559)"
           id="text557-7-6-2"
           style="font-size:29.2631px;line-height:1;white-space:pre;shape-inside:url(#rect559-6-5-9);display:inline;fill:#000000"
           x="1545.1281"
           y="0"><tspan
             x="889.69141"
             y="781.81708"
             id="tspan25580">Due to its low power usage and small size, </tspan><tspan
             x="889.69141"
             y="811.0802"
             id="tspan25582">HERMES can be installed in both mobile and </tspan><tspan
             x="889.69141"
             y="840.34333"
             id="tspan25584">fixed remote monitoring settings, such as boats </tspan><tspan
             x="889.69141"
             y="869.60645"
             id="tspan25586">or weather stations, to send real-time GPS </tspan><tspan
             x="889.69141"
             y="898.86957"
             id="tspan25588">coordinates, photos and sensor data.</tspan></text>
        <text
           xml:space="preserve"

               style="font-weight:bold;font-stretch:condensed;-inkscape-font-specification:'Bricolage Grotesque 12pt Condensed,  Bold Condensed'"
               id="tspan25590">REMOTE MONITORING</tspan></tspan></text>
        <text
           xml:space="preserve"
           transform="matrix(0.09563294,0,0,0.10893814,-63.75021,-127.3432)"
           id="text557"
           style="font-size:29.2631px;line-height:1;white-space:pre;shape-inside:url(#rect559);display:inline;fill:#000000"
           x="0"
           y="0"><tspan
             x="889.69141"
             y="781.81708"
             id="tspan25594">Together with social organizations and remote </tspan><tspan
             x="889.69141"
             y="811.0802"
             id="tspan25596">communities, first in the Amazon rainforest, and </tspan><tspan
             x="889.69141"
             y="840.34333"
             id="tspan25598">then around the world, we have been dreaming </tspan><tspan
             x="889.69141"
             y="869.60645"
             id="tspan25600">about, designing, building and testing HERMES </tspan><tspan
             x="889.69141"
             y="898.86957"
             id="tspan25604">since <tspan
       style="-inkscape-font-specification:'Fira Sans'"
       id="tspan25602">2017 to create reliable, secure, long-range, </tspan></tspan><tspan
             x="889.69141"
             y="928.13269"
             id="tspan25608"><tspan
               style="-inkscape-font-specification:'Fira Sans'"
               id="tspan25606">autonomous voice and digital communications.</tspan></tspan></text>
        <text
           xml:space="preserve"

           id="text563"

               style="font-weight:bold;font-stretch:condensed;-inkscape-font-specification:'Bricolage Grotesque 12pt Condensed,  Bold Condensed'"
               id="tspan25610">WHY WE BUILT HERMES?</tspan></tspan></text>
        <text
           xml:space="preserve"
           transform="matrix(0.09563294,0,0,0.10893814,-63.956005,-54.87913)"
           id="text557-7"
           style="font-size:29.2631px;line-height:1;white-space:pre;shape-inside:url(#rect559-6);display:inline;fill:#000000"
           x="0"
           y="0"><tspan
             x="889.69141"
             y="781.81708"
             id="tspan25614">Powered by HF radio, HERMES enables voice and </tspan><tspan
             x="889.69141"
             y="811.0802"
             id="tspan25618"><tspan
               style="-inkscape-font-specification:sans-serif"
               id="tspan25616">data communication over vast distances </tspan></tspan><tspan
             x="889.69141"
             y="840.34333"
             id="tspan25622"><tspan
               style="-inkscape-font-specification:sans-serif"
               id="tspan25620">(hundreds of kilometers) with very low power </tspan></tspan><tspan
             x="889.69141"
             y="869.60645"
             id="tspan25626"><tspan
               style="-inkscape-font-specification:sans-serif"
               id="tspan25624">consumption and without the need for Internet or </tspan></tspan><tspan
             x="889.69141"
             y="898.86957"
             id="tspan25630"><tspan
               style="-inkscape-font-specification:sans-serif"
               id="tspan25628">satellites. It can be installed practically anywhere.</tspan></tspan></text>

           transform="matrix(0.09563294,0,0,0.10893814,-59.978362,19.257188)"

           style="font-size:29.2631px;line-height:1;white-space:pre;shape-inside:url(#rect559-6-5);display:inline;fill:#000000"
           x="0"
           y="0"><tspan
             x="889.69141"
             y="781.81708"
             id="tspan25648">As an option, HERMES uses state of the art </tspan><tspan
             x="889.69141"
             y="811.0802"
             id="tspan25650">encryption and password protection to keep </tspan><tspan
             x="889.69141"
             y="840.34333"
             id="tspan25652">communications safe from prying eyes and ears.</tspan><tspan
             x="889.69141"
             y="869.60645"
             id="tspan25654"></tspan><tspan
             x="889.69141"
             y="898.86957"
             id="tspan25656">HERMES is compatible with HAM radio </tspan><tspan
             x="889.69141"
             y="928.13269"
             id="tspan25658">regulations as all security features are optional </tspan><tspan
             x="889.69141"
             y="957.39582"
             id="tspan25660">and software-configurable.</tspan></text>
